import {useParams, Link} from "react-router-dom";

const EventDetail = () => {
    const params = useParams();

    return <>
        <h1>Product Details!</h1>
        <p>{params.eventId}</p>
        <p><Link to=".." relative="path">back</Link></p>
    </>
}

export default EventDetail;
